INSERT INTO `announcements` (`id`, `user_id`, `title`, `message`, `createdtime`, `status`) VALUES
(1, 1, '  A NEW way to Earn !', 'If you find that your fellow designer has used stock logos , copyrighted images or parts from an existing logo , you will get upto 50$ from that guilty designer\'s balance by reporting them.\r\nIn this way we shall stop infringement and enhance your creativity and grow our community.\r\n\r\nThank you\r\nCONTESTHOURS', '2017-12-20 23:25:55', 0),
(2, 1, ' Any complaint From Client - Design Copy .', '  Any complaint From Client stating the design is A COPY from another website or a stock , The guilty designer will receive a deduction of -50$ and a waring point .', '2018-02-09 12:03:01', 1),
(3, 1, ' Test Notification ', 'Test Notification From Team Contesthours', '2018-02-15 10:02:02', 1),
(4, 1, ' Test Notification ', 'Test Notification From Team Contesthours', '2018-02-15 10:03:02', 1),
(5, 1, ' Any complaint From Client - Regarding Design Copy ', 'Any complaint From Client stating the design is A COPY from another website or a stock , The guilty designer will receive a deduction of -50$ and a waring point .', '2018-02-16 17:40:45', 0),
(6, 1, ' Id Proof - With Signature ', 'All Designers are requested to send their signature signed digitally  and ID Proof having your signature and your original name. \r\n\r\nPayments will be sent to all those who have updated this information.\r\nSend it to info@contesthours.com   ASAP to receive funds .\r\n\r\nThis is for the LOGO COPYRIGHT Transfer Document . ', '2018-02-16 17:47:43', 0),
(7, 1, ' Contact Us ', 'contesthours@gmail.com     or    info@contesthours.com', '2019-02-24 21:24:44', 0),
(8, 1, ' Payout Request ', 'The minimum Payout Request is $50. ', '2019-02-27 22:56:41', 0),
(9, 1, ' Upload Signature', 'All Designers are requested to UPLOAD their signature signed digitally in your profile page. Payments will only be sent to all those who have updated this information. This is for the LOGO COPYRIGHT Transfer Document .\r\n', '2019-02-28 10:07:04', 0);
