INSERT INTO `message_table` (`id`, `contest_id`, `from_id`, `to_id`, `subject`, `created_time`, `read_status`, `delete_satatus`) VALUES
(1, 1, '1', '17', 'Thank you so much!', '2017-12-23 13:40:30', 0, 0),
(2, 17, '19', '22', 'The Designer was very patient and receptive to my change requests. I highly recommend working with the designer CIKIYUNN and the website. Thanks ', '2017-12-28 00:15:41', 0, 0),
(3, 16, '18', '16', 'This was a great experience which resulted in a valuable product. Fornarel - Thanks for your design. I am pleased with the result.', '2017-12-29 00:32:15', 0, 0),
(9, 2, '2', '3', 'Please check my upload package. Let me know, If there is any changes required........', '2018-01-05 13:33:18', 0, 0),
(10, 28, '32', '34', 'Thank you very much . \nYou can contact me if you want anything else at : johnyheisen22@gmail.com \n\n', '2018-01-08 15:28:32', 0, 0),
(11, 39, '44', '42', 'Thank you so much for choosing me as the winner. I have send design package in ai, pdf, eps, jpeg and png. If you need something more about the logo, don\'t hesitate to contact me at this site or by email : design.twins@gmail.com, I will always ready to provide all your request. I hope you will satisfied with my design and my service. If everything is correct, please help me to confirm the package. Thank you again and best regards, Inge', '2018-01-09 21:32:14', 0, 0),
(12, 30, '30', '13', 'Dear Client, \n\nThank you very much have chosen me as a winner for your contest. \nI have upload the final files as you request. you can find in the attached archive. \nall the master design files are all in the archive. \n\nPlease don\'t be hesitate to leave me a message if there\'s any issue regarding the packages. \nAnd please confirm the package if everything is alright. \nThank you :) \n\nBest Regards, \nGriphon', '2018-01-13 00:34:54', 0, 0),
(13, 53, '49', '52', 'Hi Sir,\n\nI have sent the final files. Please check.\n\nThanking You\n', '2018-01-23 17:14:47', 0, 0),
(14, 56, '49', '50', 'Hi Sir,\n\nAttaching final files. Please check.\n\nThanking You\nDream', '2018-01-27 16:48:58', 0, 0),
(15, 64, '12', '60', 'Hi,\nPackage re uploaded... pls download & confirm acceptance to release the prize..! \nThanks\nGecko', '2018-01-31 09:00:09', 0, 0),
(16, 62, '59', '58', 'Hi,\nThank you so much for choosing my design, just finish uploading the final logo package of the design kindly check and please do confirm if everything is okay. In case you need any help with the logo or questions perhaps, please do leave me a message. Its been a pleasure working with you and i hope to work with you again in the future.\n\nOnce again, Thank you and Have a Great day ahead.\nWith Respect,\n-schiena', '2018-02-02 17:40:44', 0, 0),
(17, 73, '69', '29', 'you haven\'t included the fonts ', '2018-02-13 20:58:24', 0, 0),
(18, 73, '29', '69', 'I have reupload the files, including the fonts, i use calibri for the font.\n\nThank you', '2018-02-13 21:04:00', 0, 0),
(19, 78, '22', '48', 'can you find the package?', '2018-03-03 06:38:42', 0, 0),
(20, 89, '83', '77', 'Sir kindly download the final package and release the fund.', '2018-03-04 12:08:34', 0, 0),
(21, 78, '22', '48', 'do you have any update?', '2018-03-10 21:51:28', 0, 0),
(22, 78, '22', '48', 'here it is for update', '2018-03-10 22:03:42', 0, 0),
(23, 90, '25', '48', 'Please download the file package. \nI will waiting for any corrections. Thank you', '2018-03-10 23:26:09', 0, 0),
(24, 78, '22', '48', 'got it?', '2018-03-11 22:06:32', 0, 0),
(25, 78, '48', '22', 'pls don\'t use darker gradient its hard to see ', '2018-03-14 00:35:50', 0, 0),
(26, 90, '25', '48', 'please download the file package again. with the the gold and silver interchanged and full gold and full silver. \nthank you.', '2018-03-14 02:47:11', 0, 0),
(27, 90, '25', '48', 'If everything is correct please CONFIRM the package', '2018-03-14 02:55:36', 0, 0),
(28, 90, '48', '25', 'why there is no png file ?', '2018-03-14 20:56:37', 0, 0),
(29, 78, '22', '48', 'here it is for update\n\n', '2018-03-14 21:34:10', 0, 0),
(30, 90, '25', '48', 'hi LISSY\nplease download the file package, With the PNG, PSD transparance backround and TIFF transparance backround\nthank you', '2018-03-14 22:09:16', 0, 0),
(31, 78, '48', '22', 'yes like this but use a shade of orange itself', '2018-03-15 18:02:10', 0, 0),
(32, 78, '22', '48', 'here it is for update\n\n', '2018-03-15 20:01:23', 0, 0),
(33, 78, '48', '22', 'no instead of the red in the gradient use little darker a shade of orange itself\n', '2018-03-16 10:45:12', 0, 0),
(34, 90, '48', '25', 'i want transparent  png file. The Client wants transparent png not tif ', '2018-03-16 10:49:20', 0, 0),
(35, 90, '25', '48', 'I just re-upload the final file PNG in the transparant background .. \nplease download and check it .\nthank you \nbest regard \n\npakde  ', '2018-03-16 12:25:23', 0, 0),
(36, 90, '25', '48', 'Hi Lissy. I hope all the file packages are good. And please do not forget to Confirm that. Tanks. Best regard   pakde', '2018-03-18 10:07:36', 0, 0),
(37, 97, '87', '86', 'Dear Client,, Thank you so much for choosing me as your winner. The logo package is complete and ready to be confirm. Please click confirm if everything is ok. Also, please if it\'s ok don\'t forget to leave a comment(s) in my portfolio. I also include a mock up design of Stationary design and it has minimal cost only. I can make your Business Card or/and Letterhead, Envelope, Brochures, Banners, Web designs or any printable designs or any thing which is related in designing. Here is my email, sephhk@gmail.com, you can also contact me there for future projects. Thank you so much and God bless!', '2018-04-01 10:12:48', 0, 0),
(38, 97, '86', '87', 'Dear Joseph,\nApologies for the delay. Thank you very much for pulling this logo together, I\'m very satisfied and it was an excellent job. I will get in touch with you in case I need any further stationary design in future. All the best for all your endeavours. Once again thank you!', '2018-04-04 08:44:17', 0, 0),
(39, 97, '87', '86', 'Thank you so much also.\nLooking forward for future projects.\n\nBest regards,\n\nJoseph', '2018-04-04 18:51:05', 0, 0),
(44, 95, '49', '48', 'Hi Sir/Ma\'am,\nAttaching the final files. Please check and let me know if you need anything else.\n\nThanks\nSuman', '2019-02-25 20:55:53', 0, 0),
(45, 95, '49', '48', 'Hi Sir/Ma\'am, updated the files again. Please check and let me know. Thanks Suman', '2019-02-26 18:24:23', 0, 0),
(46, 95, '48', '49', 'hi just downloaded the package , I don\'t like the orange blobs in the middle .\nI will show this to the client,\nIf they confirm it i will release the payment . PLS SIGN THE DOCUMENT TOO', '2019-02-26 19:57:23', 0, 0),
(47, 95, '49', '48', 'Okay Ma\'am, i will wait for the client\'s feedback. If they need any changes i will do it and upload the files along with the documents. Thanks', '2019-02-26 20:17:45', 0, 0),
(48, 95, '48', '49', 'Thank you', '2019-02-26 20:53:00', 0, 0),
(49, 196, '126', '48', 'Respected sir, I have given the final file please release the amount.', '2019-02-26 22:50:09', 0, 0),
(50, 144, '71', '48', 'Dear CH\nThanks a lot for making me winner and now please check the package and if everything is correct then please do confirm the package.Cheers\nREgards', '2019-02-27 23:38:41', 0, 0);
