INSERT INTO `testimony` (`contest_id`, `client_id`, `message`, `createdTime`) VALUES
(1, 1, 'It was a fun process , I liked it.\r\n3 designers participated and Yuniben nailed it , cheers mate . Thank you ', '2017-12-23 13:42:54'),
(14, 14, 'Thank you so much ! Had a wonderful experience . Chuckie - Thank you so much for such a beautiful design . I absolutely love the design  . He did exactly what I needed with this logo and really listened to the feedback more than other designers. I\'m happy with what I came away with!', '2017-12-25 18:21:58'),
(6, 8, ' GECKO was very professional and took direction very well with each revision I asked for. I would highly recommend him! I love my new logo! \r\nA Very Good experience ! I have launched my business card design contest too. ', '2017-12-27 14:18:51'),
(17, 19, 'The Designer was very patient and receptive to my change requests. I highly recommend working with the designer CIKIYUNN and the website. Thanks', '2017-12-28 00:17:21'),
(16, 18, 'This was a great experience which resulted in a valuable product. Fornarel - Thanks for your design. I am pleased with the result.', '2017-12-29 00:33:23'),
(19, 14, 'Really original and creative concepts by Avatar. Easy to work with, very attentive, very prompt. A true professional! ', '2017-12-29 01:42:52'),
(8, 7, 'He was very responsive and open to requests or suggestions. Not only did he respond to requests and suggestions very well, but his natural creative flair for design actually changed what I had in mind and very much for the better ! He incorporated our ideas wonderfully to his own and we are so happy with his work, we hope to continue working with him. INSERT INTO `transaction` (`id`, `reward_id`, `designer_id`, `trans_date`, `trans_value`, `trans_old_balance`, `trans_new_balance`) VALUES
